import React from 'react';
import styles from './Loginpage.module.css'; // CSS 모듈 파일 임포트

function LoginPage() {
    return (
        <div className={styles.mainImageContainer}>
            <img src="main.png" alt="Main Background" className={styles.mainImage}/>
            <img src="man1.png" alt="Man 1" className={styles.man}/>
            <img src="man2.png" alt="Man 2" className={styles.man}/>
            <img src="man3.png" alt="Man 3" className={styles.man}/>
        </div>
    );
}

export default LoginPage;
